  [],\n\t\"revision_timestamp\": \"2015-05-07T01:26:04.568430\",\n\t\"name\": \"electrochemical-dehumidification-and-life-support-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Sustainable Innovations has developed an
  innovative concept for highly efficient, reliable, potable water production based
  on technology from a commercial line of hydrogen recovery and compression systems
  the company is developing.   This Electrochemical Dehumidification and Life Support
  System (EDLS) system utilizes a small amount of hydrogen as a working fluid, operating
  in a sealed cavity, and leverages a hydrogen compression cycle to provide the driving
  force to both remove water from the local environment, passing it into a dry hydrogen
  stream, and condense pure, potable drinking water.  The hydrogen compression cycle
  used in this process is highly efficient, approaching the efficiency of an ideal
  isothermal compression process, and can be achieved without moving parts.  This
  technology could play a key role in critical NASA environmental control and life
  support applications.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
